import Parse from "parse/dist/parse.min.js";

// Create a new User
export async function createParseUser(bookingId, name, passwordConfirm) {
  // Creates a new Parse "User" object, which is created by default in your Parse app
  let user = new Parse.User();
  // Set the input values to the new "User" object
  user.set("bookingId", bookingId);
  user.set("username", name);
  user.set("password", passwordConfirm);
  try {
    // Call the save method, which returns the saved object if successful
    user = await user.save();
    if (user !== null) {
      // Notify the success by getting the attributes from the "User" object, by using the get method (the id attribute needs to be accessed directly, though)
      alert(
        `New object created with success! ObjectId: ${user.id}, 
        ${user.get("username")}, ${user.get("password")}`
      );
    }
  } catch (error) {
    alert(`Error: ${error.message}`);
  }
}

export function queryBookingId(bookingIdInput) {
  const Booking = Parse.Object.extend("Booking");
  let query = new Parse.Query(Booking);
  query.equalTo("key", bookingIdInput);
  query.find().then((result) => {
    alert(`Succesfully found a booking: ${result.get("key")}`),
      (error) => {
        alert("error: " + error);
      };
  });
}
